import './App.css'
import Loader from 'react-loader-spinner'

function Spinner() {
    return (
        <div>
            <Loader
                type={"Puff"}
                color={"#00BFFF"}
                height={100}
                width={100}
                timeout={10 * 3000} // 3 seconds
            />
        </div>
    );
}

export default Spinner;
